    perfil_usuario:{
        type: Sequelize.STRING(40)
    },
    descripcion:{
        type: Sequelize.STRING(40)
    },
    porciento_descuento:{
        type: Sequelize.DECIMAL(3)
    }
},
{
    timestamps: false,
    freezeTableName: true,
    allowNull: false
});

export default PerfilUsuario;

